import { View, Text, TouchableOpacity, Image, ScrollView } from 'react-native';
import React from 'react';
import { SafeAreaView } from 'react-native-safe-area-context';
import { COLORS, icons } from '../constants';
import {Chartsawit, Chartkaret, Chartkelapa, Chartkopi, Chartpinang, Chartsagu} from '../screens/index';

const Home = ({ navigation }) => {
  return (
    <SafeAreaView style={{
    }}>
      <ScrollView>
      <View style={{
        flexDirection: 'row',
        justifyContent: 'space-between',
        backgroundColor: COLORS.green,
        padding: 16,
        maxHeight: 100,
      }}>
        <TouchableOpacity
          onPress={() => navigation.toggleDrawer()}
          style={{
            height: 45,
            width: 45,
            borderRadius: 999,
            alignItems: "center",
            justifyContent: "center",
            backgroundColor: COLORS.gray,
          }}
        >
          <Image
            source={icons.menu}
            resizeMode='contain'
            style={{
              height: 24,
              width: 24,
              tintColor: COLORS.black,
            }}
          />
        </TouchableOpacity>
        <Text
          style={{
            fontSize: 20,
            fontWeight: "bold",
            color: COLORS.black,
            marginTop: 10,
            marginLeft: 10,
            height: 50,
          }}
        >SIPBUN BENGKALIS
        </Text>
        <Image
          source={icons.logo}
          resizeMode='contain'
          style={{
            height: 50,
            width: 50,
            tintColor: COLORS.black,
          }}
        />
      </View>
      <View style={{
        backgroundColor: COLORS.white,
        padding: 16,
      }}>
        <Text
          style={{
            fontSize: 16,
            fontWeight: 'bold',
            color: COLORS.black,
            textAlign: 'left',
          }}
        >Cari Berdasarkan Kecamatan
        </Text>
      </View>
      <View >
        <Chartsawit/>
        <Chartkelapa/>
        <Chartkaret/>
        <Chartpinang/>
        <Chartkopi/>
        <Chartsagu/>
      </View>

      </ScrollView>

    </SafeAreaView>
  );
}

export default Home;
